- input: "TEXT\x1CC00001917\x1CTEXT-00001\x1C\x1CF3XA\x1CThe committee is in receipt
    of the FEC's letter of June 22, 2011, specifically regarding our February Monthly
    Report. The issue raised in that letter made us aware that we incorrectly reported
    two transactions - one from Dec. 21, 2010, and the other that we had dated Jan.
    31, 2011 (which should have appropriately been dated on or before Dec. 21, 2010).
    Both of these transactions were in the amount of $4,120.69. One was a receipt
    and one was a disbursement. This was, in fact, a transfer from one of our internal
    Federal bank accounts to another. Upon researching this issue, we discovered that
    we did not need to report such transactions when we engaged in similar activity
    from the 2008 election cycle. Thus, we are amending this 2010 Monthly Year End
    report and our February 2011 Monthly Report to exclude this internal transfer
    and to make the appropriate corrections to our ending cash balances.  Any payroll
    items on Schedule H4 were for the benefit of employees who did not spend over
    25% of the compensated time on federal election activity. Any payments for health
    insurance stipends are not cash payments, but they are instead in the form of
    checks written to employees.\n"
